        <h1>Fly Control For Greener Beef-Pastures</h1>
        <p>To control manure-breeding flies, all cattle on your premises need to consume adequate quantities of ClariFly<sup>®</sup>&nbsp;Larvicide every day. Protect your beef cow performance with a feed-through that stops flies in their larval stage.</p>
